import React, { useEffect, useState } from 'react';
import Button from 'react-bootstrap/Button';
import Navbar from '../navSection/Navbar';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/InputGroup';
import { Link, useNavigate } from 'react-router-dom';
import Footer from '../footerSection/Footer';
import axios from 'axios';
import HttpsIcon from '@mui/icons-material/Https';
import { useDispatch, useSelector } from 'react-redux';
import { fetchSuccess } from '../redux/userSlice';

import { toast } from 'react-toastify';
import { api } from '../utils/apiConfig';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';

function SignIn() {
  const [name, setName] = useState('');
  const [password, setPassword] = useState('');
  const dispatch = useDispatch();
  const navigate = useNavigate();
  const { userInfo } = useSelector((state) => state.user);

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const { data } = await axios.post(
        `${api}/api/users/signin`,
        {
          name: name,
          password: password,
        }
      );
      dispatch(fetchSuccess(data));
    } catch (error) {
      toast.error(error.response.data.message, {
        autoClose: true,
        theme: 'colored',
        toastId: 'unique-toast-id',
      });
    }
  };

  useEffect(() => {
    if (userInfo?.user?.name) {
      navigate('/');
    }
  });

  return (
    <div>
      <Navbar />
      <div
        style={{
          backgroundColor: 'lightgrey',
          overflowX: 'hidden',
          position: 'relative',
          height: '840px',
        }}
      >
        <img
          src="/mbite.jpeg"
          alt=""
          style={{
            width: '100%',
            opacity: '0.1',
            height: '100%',
            objectFit: 'cover',
          }}
        />
        <div style={{ position: 'absolute', left: 0, width: '100vw', top: 10 }}>
          <Row className="">
            <Col
              md={6}
              className="d-flex mb-3  justify-content-center  flex-column align-items-center"
            >
              <div
                className="bg-light p-3 border rounded-3 d-flex flex-column align-items-center"
                style={{ width: '100%' }}
              >
                <h3>Join M-Bite global market today</h3>
                <p>
                  {' '}
                  We are one of the fastest growing online market <br /> you can buy and sell your products.
                  <br /> create a store today in a reliable enviroment tp sell your products {' '}
                </p>
              </div>
            </Col>
            <Col
              md={6}
              className="d-flex  justify-content-center  flex-column align-items-center"
            >
              <Button
                variant="success"
                className="bg-success opacity-75 p-1"
                style={{ borderRadius: '50%' }}
              >
                <HttpsIcon />
              </Button>
              <strong className='mb-2'>Sign In</strong>
              <Form
                onSubmit={handleLogin}
                className="bg-light p-2 border rounded-4"
              >
               
               
           
             
               
            
                <InputGroup className="my-3 ho border border-secondary  ">
                  <InputGroup.Text className="titl ">Name</InputGroup.Text>
                  <Form.Control
                    className=" inpu "
                    type="text"
                    onChange={(e) => setName(e.target.value)}
                  />
                </InputGroup>
                <InputGroup className="my-3 ho border border-secondary  ">
                  <InputGroup.Text className="titl ">Password</InputGroup.Text>
                  <Form.Control
                    className=" inpu "
                    type="password"
                    onChange={(e) => setPassword(e.target.value)}
                  />
                </InputGroup>
                
                <div className="d-grid my-3">
                  <Button
                    variant="success"
                    className="bg-success border rounded-5"
                    type="submit"
                  >
                    Login
                  </Button>
                </div>
              </Form>
              <div>
                <strong>
                  {' '}
                 New customer ? <Link to="/signin"> sign up here</Link>
                </strong>
              </div>
        
            </Col>
          </Row>
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default SignIn;
